import React from 'react';
import { GoogleLogin } from 'react-google-login';

const clientId = '100494854374-u8q7012stasfgi3iepju6pg5he78ofqo.apps.googleusercontent.com';

function Login() {
    var name = "Pasha";
    const onSuccess = (res) => {
        console.log( '[Login Success] currentUser:', res.profileObj.name);
        return(res.profileObj);
    };

    const onSuccessName = (res) => {
        return res.profileObj.name ;
    }
    const onFailure = (res) => {
        console.log('[Login failed] res:', res);
    }

    return(
        <div>
            <GoogleLogin 
                clientId={clientId}
                buttonText="Login"
                onSuccess={onSuccess}
                onSuccessName={onSuccessName}
                onFailure={onFailure}
                cookiePolicy={'single_host_origin'}
                style={{ marginTop: '100px' }}
                isSignedIn={true}
            />
            <p>{onSuccess}</p>
        </div>
    );
}

export default Login;
